import { AddProdact, GetAllProdact } from "../actios/acionprodact";


export const AddReduser=(state=[],action)=>{
switch(action.type){
case AddProdact:
return [...state,action.paylod]
case GetAllProdact:
return [...action.paylod]
default :
return state
}
}
